【商品説明】<BR>
■背の部分は通気性を高めたパンチング加工を施しています。<BR>
■シートカバーの強度と高級感を演出するダブルステッチ仕様。<BR>
■不意のタバコ落下にも安心の難燃PVCレザー採用で<BR>
　 シートを傷めません。<BR>
■お子様にも安心の防水PVCレザー採用で<BR>
　 拭き取りもらくらくです。<BR><BR>

【適合車種】<BR>
トヨタ　ノア/ヴォクシー<BR><BR>

【適合年式】<BR>
H19.06～H22.04<BR><BR>

【適合型式】<BR>
ZRR70W/75W<BR><BR>

【適合グレード】<BR>
ノア…Si,SX,ZS,Z,X<BR>
ヴォクシー…ZS,Z,V-4WD,X-Lセレクション,X,ZS-煌<BR><BR>

【仕様】<BR>
2列目タンブルシート<BR>
サイドエアバッグ車不可<BR><BR>

【定員】<BR>
8人<BR><BR>

【カラー】<BR>
ブラック<BR>
ベージュ<BR><BR>

【ご注意】<BR>
・適合グレードにご注意ください。<BR><BR>

※商品はメーカー直送商品となります。<BR>　代引きでの発送はお受け出来ませんのでご了承下さいませ。<BR><BR><br>







