【商品説明】<BR>
■ダイヤデザイン<br>背の部分は通気性を高めたパンチング加工を施しています。<BR>
■ダブルステッチ<br>シートカバーの強度と高級感を演出するダブルステッチ仕様を採用。<BR><br>
■安心の耐火構造<br>タバコの落下時等に安心の燃えにくい難燃素材のレザー仕様です。<BR>安心構造でシートカバーを守ります。<br><BR>
■PVCレザー仕様の安心構造<br>PVCレザーでコーヒーやジュースをこぼしても染み込まず、簡単にふき取れる防水レザー仕様の安心構造。<BR><BR>

【適合車種】<BR>
トヨタ　新型プリウス(30プリウス)<BR><BR>

【適合年式】<BR>
H21.05～現在<BR><BR>

【適合型式】<BR>
ZVW30<BR><BR>

【適合グレード】<BR>
S, S-ツーリングセレクション, G, G-ツーリングセレクション<BR><BR>

【仕様】<BR>
運転席シートリフター付用<BR>コンソールカバー付<BR>2列目センターアームレスト/センターヘッドレスト有<BR>※レザーパッケージ不可<BR>※グレードL不可<BR><BR>

【定員】<BR>
5人<BR><BR>

【カラー】<BR>
ブラック/シルバーステッチ<BR><BR>

【ご注意】<BR>
・適合グレードにご注意ください。<BR><BR>

※商品はメーカー直送商品となります。<BR>　代引きでの発送はお受け出来ませんのでご了承下さいませ。<BR><BR><br>







